import React from 'react';

import SiteNavbar from './SiteNavbar';

import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

import TeamText from '../img/team/team-text.png';
import Samarth from '../img/team/samring.png';
import Vicky from '../img/team/vickyring.png';
import Aditya from '../img/team/aditring.png';
import Justin from '../img/team/justinring.png';
import Ervin from '../img/team/ervinring.png';
import Spider from '../img/team/spider.png';

import '../css/Team.css';

const Team = () => {
	function samarth(e) {
		document.getElementById('name').innerHTML = 'Samarth Goel';
		console.log('hi');
	}

	function vicky(e) {
		document.getElementById('name').innerHTML = 'Vicky Li';
		console.log('hi');
	}

	function aditya(e) {
		document.getElementById('name').innerHTML = 'Aditya Bhawal';
		console.log('hi');
	}

	function justin(e) {
		document.getElementById('name').innerHTML = 'Justin Chen';
		console.log('hi');
	}

	function ervin(e) {
		document.getElementById('name').innerHTML = 'Ervin Baccay';
		console.log('hi');
	}

	return (
		<div className="team">
			<SiteNavbar />
			<div className="title-container">
				<img src={TeamText} alt="team text" />
				<p className="subtitle">
					Hover over photo to
					<br />
					view bios
				</p>
			</div>
			<Container fluid className="body">
				<Row>
					<Col xs={6} className="text-col">
						<h2 className="name" id="name">
							Samarth Goel
						</h2>
						<h3 className="role">Co-President and VP Finance</h3>
						<p className="description">Placeholder</p>
					</Col>
					<Col xs={2} className="image-col">
						<img
							src={Samarth}
							alt="samarth"
							className="team-image member-1"
							onMouseEnter={samarth}
						/>
						<img src={Spider} alt="spider" className="team-image member-2" />
					</Col>
					<Col xs={2} className="image-col">
						<img
							src={Vicky}
							alt="vicky"
							className="team-image member-3"
							onMouseEnter={vicky}
						/>
						<img src={Ervin} alt="ervin" className="team-image member-4" />
					</Col>
					<Col xs={2} className="image-col">
						<img src={Aditya} alt="aditya" className="team-image member-5" />
						<img src={Justin} alt="justin" className="team-image member-6" />
					</Col>
				</Row>
			</Container>
		</div>
	);
};

export default Team;
